          const [isDragging, setIsDragging] = useState(false);
          const [startPoint, setStartPoint] = useState({ x: 0, y: 0 });
    
            useEffect(() => {
  console.log("PanX:", panX, "PanY:", panY, "Zoom:", zoomLevel);
}, [panX, panY, zoomLevel]);
           
