          engineering: { panX: -489 , panY: -69 , zoom: 2.000000000000001 },
          library: { panX: 27 , panY: 377 , zoom: 2.200000000000001 },
          cot: { panX: 90, panY: -237 , zoom: 2.4000000000000012 },
